VALUES ('8711508503963', 'Deluxe Mini Chocolates Raspberry', 'cocoa mass, sugar, cocoa butter, raspberries (1,5%), emulsifier: soya lecithin, natural flavours. Cocoa solids: 52% minim um in the chocolate. May contain traces ofmilk, egg, nuts, Wheat and barley. Keep cool and dry. Best before: see end of pack. (D E) Zartbitterschokolade mit Himbeeren. Zutaten: Kakaomasse, Zucker, Kakaobutter, Himbeeren (1,5%), Emulgator: Sojalecithine, nat? ürliche Aromen. Kakao: 52% mindestens in der Schokolade. Kann Spuren von Milch, Ei, Nüssen, Weizen und Gerste enth alten. Vor Warme und Feuchtjgkeit schützen. Mindestens haltbar bis: siehe Bodendeckel. (NL) Pure chocolade met frambozen. I ngrediënten: cacaomassa, suiker, cacaoboter, frambozen (1,5%), emulgator: sojalecithine, natuurlijk / aroma\'s. Cacaobestanddelen: ten minste 52% in de chocolade. Kan sporen van melk, ei, noten, tarwe en gerst bevatten. \\ Koel en droog bewaren. Ten minste houdbaar tot: zie onderkant verpakking. (FR) chocolat noir aux framboises. Ingrédients.\' pâte de cacao, sucre, beurre de cacao, framboises (1,596), émulsifiant: lécithine de soja, arômes naturel. Cacao: 52% minimum dans le chocolat. Pourrait contenir des traces de lait, d\'oeuf, de noix, de blé et d\'orge. Protéger de la chaleur et de l\'humidité. A consommer de préférence avant le: voir fond du paquet. (IT) Cioccolato fondente con lamponi. Ingredienti: pasta di cacao, zucchero, burro di cacao, emulsionante: lecitina di scia, aroma naturale. Cacao: 52% minimo nel cioccolatofondente. Può Conservarein luogofrescoeasciutto. \\ Da consumarsi preferibilmente entro il: vedifondoconfezione. (ES) Chocolate negro con frambuesas. Ingredientes: pasta de cacao, azécar, manteca de cacao, frambuesas (1,5%), emulgente: lecitina de soja, aroma natural. Cacao: 52% minimo en el chocolate negro. Puede contener trazas de leche, huevo, nueces, trigo y cebada. Conservar en un lugar fresco y seco. A consumir preferentemente antes del: ver base del envase. (PT) Chocolate amargo com framboesas. Ingredientes: pasta de cacau, açücar, manteiga de cacau, framboesas (1,5%), emulsificante: lecitina de soja, aroma natural. Cacau: 52% minimo no chocolate amargo. Contém vestigios de leite, ovo, nozes, trigo e cevada. Conservar em lugar fresco e secco. Consumir de preferência antes de: ver no fondo de embalagem. (DK) Mark chokolade med / hindbar. Ingredienser: kakaomasse, sukker, kakaosmor, hindbar (1,5%), emulgator: soja-lecithiner, naturlige smagsstoffe[ Mindst 52% kakaotorstofi chokoladen. Kan indeholde spor af malk, ngdder, ag, hvede og byg. Opbevares tort og ikke for varmt. Bedst for: se bunden. (EE) Tume Sokolaad vaarjkatega. Koostis: kakaomass, suhkur, kakaovôi, vaarikad (1,5%), emulgaator: sojaletsitiin, naturaalsed maitseained. Kakaosisaldus Sokolaadjs min. 52%. Vôib sisaldada piima, muna, pâhklite, Odra ja nisu jüke. Hoida jahedas ja kuivas. Parim enne: vaata pakilt. Toodetud Hollandjs. Turustaja: Nenaly Trade 00, tel 56 876 510, www.nenalytrade.eu', '', '31', '19', '48', '45', '', '9.5', '0.017', '0.00669291338582677', '', '0');

