VALUES ('8712100345111', 'Proactive', 'Creme vegetal para barrar a 59% com ester6is vegetais adicionados Ingredientes: éleos vegetais (girassol, colza e linhaça, em proporçôes variâveis), gordura de palma, âgua, ésteres de ester6is vegetais*** (9%), sal (1%), LEITELHO, emulsionantes (mono diglicéridos de Acidos gordos e lecitina de girassol), regulador de acidez (âcido ciMco), aromas rais (contém LEITE), conservante (sorbato de potâssio), corante (carotenos), vftamina A e D. quivalente a esteréis vegetais (5,4%). i demonstrado que os esteréis vegetais reduzem o colesterol no sangue. Colesterol elevado é um de risco no desenvolvimento de doenças coronârias. Estâ demonstrado que o consumo de uma diâria de 1,5-3,0 g de esteréis vegetais pode reduzir o colesterol. Este produto nâo se destira a as que nâo necessitem de controlar os niveis de colesterol no sangue. 0 consumo de umadose a de 1,5-2,4 g de esteréis vegetais pode baixar o colesterol entre 7 a em 2 a 3 semanas. ;uma à refeiçâo como parte de um regime alimentar equilibrado e do, que inclua o consumo frequente de frutas e produtos horticolas para', '', '59', '12', '30', '5', '', '5', '1', '0.393700787401575', '', '0');

