INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('8712100494611', 'Proactiv', 'huiles végétales 54% (tournesol, colza, palme\', lin), eau, ester de phytostérols (12,5%, équivalant à 7,5% de stérols végétaux), matières sèches de LAIT, émulsifiants (mono- et diglycerides d\'acides gras, lécithine de tournesol), arômes (dont LAIT), conservateur (sorbate de potassium), acidifiant (acide citrique), vitamines (A et D), colorant (carotène). Ceci est de l\'huile de palme durable. Surfez sur: www.unilever.be/fr/modedeviedurable. Gekoeld bewaren (2-70C). Niet invriezen. Conserver au frais (2-70C). Ne pas congeler. Niet gebruiken voor bakken en braden, Ne pas utiliser pour la cuisson. Ten minste houdbaar tot: zie deksel, A consommer de préférence avant le: voir couvercle. Gebruikers van cholesterolverlagende medicijnen dienen met hun arts te overleggen alvorens Becel ProActiv te gebruiken. Dit product is vanuit voedingsoogpunt mogelijk niet geschikt voor zwangeren, vrouwen die borstvoeding geven en kinderen onder de vijf jaar. Si vous prenez des médicaments qui réduisent le taux de cholestérol, demandez conseil à votre médecin. run point de vue nutritionnel, il est possible que ce produit ne soit pas adapté aux femmes enceintes, qui allaitent et aux enfants de moins de 5 ans.', '', '59', '12', '0.5', '0.5', '0', '0.5', '0.04', '0.015748031496063', '', '0');

